import React, { Component } from 'react'
import './App.css';

export default class App extends Component {
    render() {
        return (
            <div className='App'>
            <header>
                <form id='to-do-form'>
                    <input type='text' placeholder='Enter text'/>
                    <button type='submit'>Add</button>
                </form>
            </header>
           
                
            </div>
        )
    }
}
